		transition: 0.125s ease;
		width: calc(100% + 4px);
		z-index: -2;
    }
`;

const Logo = styled.img`
    -webkit-touch-callout: none;
    -webkit-user-select: none;
    border-radius: 11px;
    box-shadow: 0px 2px 6px rgba(0, 0, 0, 0.2);
    margin-left: 6px;
    margin-right: 10px;
    margin-top: 2px;
`

const Label = styled.div`
    background: url(https://raw.githubusercontent.com/christianbaroni/rainbow-buttons/7186dbd3e6ba3e4b92e925fe97acfe21036d9f2b/1/button-label.svg) no-repeat;
    background-size: 100% 100%;
    height: 14px;
    opacity: 1;
    transition: 0.125s ease;
    width: 175px;
    will-change: transform;
`

function ConnectButton({
    chainId,
    metadata,
    methods,
    onClientInitialized,
    relayProvider,
}: { chainId: string, relayProvider: string, metadata: AppMetadata, methods: string[], onClientInitialized: (client: WalletConnectClient) => void }) {
    const [uri, setUri] = useState<string>('');
    const [showQRCode, setShowQRCode] = useState<boolean>(false);

    const connectToRainbow = useCallback(() => {
        if (!uri) return
        if (userAgentIsMobile()) {
            window.location.href = uri!
        } else {
            setShowQRCode(true)
        }
    }, [uri])

    const callbackOnClientInitialized = useCallback((client) => {
        console.log('butonnnnn callbackOnClientInitialized')
        onClientInitialized?.(client)
    }, [onClientInitialized])

    useEffect(() => {
        const walletConnectInit = async () => {
            console.log(';walletConnectInitwalletConnectInitwalletConnectInit')
            const client = await WalletConnectClient.init({
                relayProvider,
                metadata
            });
            client.on(
                CLIENT_EVENTS.pairing.proposal,
                async (proposal: PairingTypes.Proposal) => {
                    const { uri } = proposal.signal.params;
                    const deeplink = constructDeeplink(uri)
                    setUri(deeplink)
                },
            );
            callbackOnClientInitialized(client);
            await client.connect({
                permissions: {
                    blockchain: {
                        chains: [chainId],
                    },
                    jsonrpc: {
                        methods,
                    },
                },
            });

        }
        walletConnectInit()
        console.log('BUTTON INIT', chainId, metadata, methods, callbackOnClientInitialized, relayProvider)
    }, [chainId, metadata, methods, relayProvider]);

    useEffect(() => {
        new Fountain()
    }, [])

    return (
        <div >
            {showQRCode && <QRExpandedState setIsQRCodeOpen={setShowQRCode} value={uri} />}
            <Content id="content">
                <Button id="rainbow-button" onClick={connectToRainbow} >
                    <ButtonInner>
                        <Logo src="https://github.com/christianbaroni/rainbow-buttons/blob/main/1/rainbow-logo.png?raw=true" width="34" />
                        <Label id="rainbow-button-label" />
                    </ButtonInner>
                </Button>
            </Content>

        </div>

    );
}

export default React.memo(ConnectButton);

